window.bookSummaryJSON = "<p><b>A princess determined to survive an arranged marriage to a heartless faerie prince is saved by a twist of fate that could destroy their world in this all-new </b><b><i>standalone</i></b><b> fantasy romance.</b></p> <p>As the half faerie daughter of a human king, my days were spent tucked out of sight—until the Seelie Fae sought an alliance with our kingdom. In exchange for my father’s help in defeating their Unseelie enemies, I would wed Atakan the heartless.</p> <p>The Seelie prince loathed everyone, but none more than me. Throughout the years leading to our nuptials, each encounter grew more terrifying than the last as he demonstrated how he’d earned his infamous reputation.</p> <p>Fear would only doom me faster. So I learned to hide it with games I soon became happy to play. I wasn’t supposed to crave a monster. But just when I’d thought I might tame the untameable, fate intervened.</p> <p>And delivered me straight to his enemy.</p> <p><b><i>This fast-paced standalone features true enemies to lovers, arranged marriage, high heat, and a cast of morally grey and villainous characters.</i></b></p>"; 
